import React from 'react';
import Link from 'next/link';

const Navbar = () => (
    <React.Fragment>
    <ul>
        <li>
            <Link href='/'><a>Inicio</a></Link>
            <Link href='/nosotros'><a>Nosotros</a></Link>
        </li>
    </ul>
</React.Fragment>
);

export default Navbar;
